import Link from "next/link";
import { Container, Card, CardImg, CardText } from "@bootstrap-styled/v4";

const ResultView = ({ resultName }) => {
  return (
    <>
      <Container>
        <Card width="25%">
          <CardImg
            top
            src={`https://robohash.org/${resultName}?set=set4&size=300x300`}
            alt="monster"
          />
          <CardText>{resultName}</CardText>
        </Card>
        <img
          alt="monster"
          src={`https://robohash.org/${resultName}?set=set4&size=300x300`}
        />
      </Container>
      <Link href="/">
        <a>Try Again</a>
      </Link>
    </>
  );
};

const Result = (props) => {
  const { resultName, isCountDown } = props;

  return (
    <>
      {isCountDown ? (
        <ResultView resultName={resultName} />
      ) : (
        <Link href="/">
          <a>Try Again</a>
        </Link>
      )}
    </>
  );
};
export default Result;
